import React from "react";
import { isStyledComponent } from "styled-components";

const Container = isStyledComponent.div`
    width: 100%;
    height: 100vh;
    color: teal;
`;


export const Slider = () => {
    <Container>
        hello how are you
    </Container>
};

export default Slider;
